script: |
  super -f text -I q666.spq | sort > q666.out

inputs:
  - name: q666.spq
    data: |
      SELECT DISTINCT col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - ( + col0 ) - + + 72 * ( + + 0 ) + col2 - + col1 + - - col2 * - 17 * + + 41 * col2 IS NULL;
  - name: tab0

outputs:
  - name: q666.out
    data: |
      15
      87
      97
